import { ruleData }  from '@/mixins/ruleData.js'
export default {
	mixins:[ruleData],
	data: () => ({
		moreObj:{},
		lookMore:false
	}),

	methods:{
		closeLay(){//关闭弹出层
			this.moreObj = {};
			this.lookMore = false;
		},

		lookOne(i,item) { //查看折叠的内容
			this.lookMore = true;
			this.moreObj = {
				R4:item.R4,
				R5:item.R5,
				R6:item.R6,
				R7:item.R7,
				R8:item.R8,
				R9:item.R9,
				R10:item.R10
			};
		}
	}

}
